                                <li><a href="#">Plans & Pricing</a></li>
                                <li><a href="#">Learning Lab</a></li>
                                <li><a href="#">Marketplace</a></li>
                            </ul>
                            <ul className="user-info">
                                <li><a href="#">Login</a></li>
                                <li><a href="#" className="btn">Start Free Trial</a></li>
                            </ul>
                        </nav>
                    </input> */}
                </div>
            </header>
        );
    }
}

export default Header;
